   "source": [
    "# Splitting the dataset into the Training set and Test set\n",
    "# install.packages('caTools')\n",
    "library(caTools)\n",
    "set.seed(123)\n",
    "split = sample.split(ds$Salary, SplitRatio = 2/3)\n",
    "split"
   ]
  },
