   "source": [
    "# Fitting Simple Linear Regression to the Training set\n",
    "regressor = lm(formula = Salary ~ YearsExperience,\n",
    "               data = train_set)\n",
    "\n",
    "# Predicting the Test set results\n",
    "y_pred = predict(regressor, newdata = test_set)\n",
    "print(head(y_pred,3))"
   ]
  },
